from collections import Counter
class Solution:
    def topKFrequent(self, nums, k):
        def rise_up(heap):
            '''
            加入新元素后，进行上浮操作
            '''
            i = len(heap) - 1
            while i // 2 >= 1:
                # 比上一层大
                if heap[i][0] < heap[i // 2][0]:
                    heap[i], heap[i // 2] = heap[i // 2], heap[i]
                    i = i // 2
                else:
                    break
            return

        def sink_down(heap):
            '''
            poppush
            顶端值往下沉，找新的最小值
            '''
            root = 1
            n = len(heap)
            
            while root * 2 < n:
                child = 2 * root
                # 比较左右子节点，找到小的那个
                if child + 1 < n and heap[child][0] > heap[child + 1][0]:
                    child += 1
                # root与子节点相比
                if heap[child][0] < heap[root][0]:
                    heap[child], heap[root] = heap[root], heap[child]
                    root = child
                else:
                    break
            return

        
        count = Counter(nums)
        pairs = [(v, k) for k, v in count.items()]
        heap = [(0, 0)]

        # 构建一个规模为k + 1的堆，新元素加入堆尾，然后上浮
        for i in range(k):
            heap.append(pairs[i])
            rise_up(heap)

        print(heap)

        # poppush
        # 维护规模为k + 1的最小堆，如果新元素不是最小值，需要下沉
        for i in range(k, len(pairs)):
            # 新元素比现有最小值还要小
            # 注意heap[0]是占位符
            if heap[1][0] >= pairs[i][0]:
                continue
            # pop最小值，加入新值
            heap[1] = pairs[i]
            sink_down(heap)
        return [elem[1] for elem in heap[1:]]


